import React from 'react'
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';



export default function Navigation() {
  return (
    <div>
     <Navbar bg="light" data-bs-theme="light">
        <Container>
          
          <Nav className="me-auto">
            <Nav.Link href="#home"    style ={{marginLeft:'150px',fontSize:'25px',fontWeight: 'bold'}}>Home</Nav.Link>
            <Nav.Link href="#features"style ={{marginLeft:'150px',fontSize:'25px'}}>Rooms</Nav.Link>
            <Nav.Link href="#pricing" style ={{marginLeft:'150px',fontSize:'25px'}}>Contact Us</Nav.Link>
            <Nav.Link href="#pricing" style ={{marginLeft:'150px',fontSize:'25px'}}>About Us</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
    </div>
  )
}
